import {Row, Col} from "antd";

function Header() {
	return (
		<Row gutter={24}>
			<Col xs={2} sm={4} md={6} lg={8} xl={10}>
				col-12
			</Col>
			<Col xs={2} sm={4} md={6} lg={8} xl={10}>
				col-12
			</Col>
		</Row>
	);
}

export default Header;
